const reducer = (state = '', action) => {
    switch (action.type) {
        case "deposit":
            return state + action.payload;
        case "withdraw":
            return state - action.payload;
        case "success":
            alert('successfully logged in..... ')
            // if (action.payload == 200) {
            //     return 'successfully logged in '
            // }

        default:
            return state
    }
};

export default reducer;
